import axios from "axios";
import React, {useState} from "react";
import { toast } from "react-toastify";
function ReportDonation(){
    const [data, setData] = useState([])
   const generate = ()=>{
    axios.get('http://localhost:3001/api/Blood/report').then((response)=>{

        if(response.data.error){
            toast.error(response.data.error)
        }else{
            console.log('generate report');
            console.log(response.data);
            setData(response.data)
        }
    })

   }

    return (

        <div>

            <button onClick={generate}>Generate</button>

         
            <div id="main1">
            <div id="heading">
                <h1 >Personal Details</h1>
            </div>
            <button id="reqbtn" onClick={show}><h3>Find</h3></button>
            
            </div>
        {
            requestList.map((val,key)=>{
                return (
                    
                    <div className="requests">
                        
                        <div>
                            <div className="main">
                            <h1>Cnic : {val.cnic}</h1>
                            <h1 id="reqid">Blood Group: {val.blood_group}</h1>
                            </div>
                            <h3>Name: {val.fname + " " + val.lname}</h3>
                            <h3>Weight: {val.weight}</h3>
                            <h3>no. of time donate: {val.frequencyDonation}</h3>
                            <h3>IsDiabetes?: {val.IsDiabetes}</h3>
                            <h3>IsHypetitus?: {val.IsHypetitus}</h3>
                            {
                                requestList2.map((val2,key)=>{
                                    return(
                                            <h3>ContactNo{(key+1) + ": 0" +val2.contactno}</h3>
                                    );
                                })
                            }
                            {
                                requestList3.map((val3,key)=>{
                                    return(
                                            <h3>Location: {val3.postalCode+" , " + val3.Area + " , " + val3.City}</h3>
                                    );
                                })
                            }
                        </div>

                    </div>
                );
            })
        }
       
        </div>


    

    );


}

export default ReportDonation;
